window.bookSummaryJSON = "<p>Val had returned from his latest tour of duty scarred in body and soul. Barely able to walk and drugged to the gills for pain, he thought his killing days were finally behind him. He couldn't have been more wrong.&nbsp;</p> <p>Endless Online, a hyper futuristic game where players could truly live another life...</p> <p>Val loved the idea of starting over in virtual reality. But when someone he cares about turns up missing after chasing that same dream, Val quickly learns that Endless is no simple game.&nbsp;</p> <p>And if Val can't figure out the dark secrets behind this realm of wizards, warriors, and intergalactic conquest, then it's game over. For everyone...</p>"; 
